import { BrowserRouter as Router, Route } from "react-router-dom";
import SignUp from "./components/SignUp";

function App() {
  return (
    <Router>
      <Route  path="/" component={SignUp} />
      <Route exact path="/signup" component={SignUp} />
    </Router>
  );
}

export default App;
